import React from 'react';
import {Link} from "react_dom";

const NavBar = () => {
    return (
        <div>
            <ul>
                <li><Link to='/'>Accueil</Link></li>
                <li><Link to='/ToShowMovies'>ToShowMovies</Link></li>
            </ul>
        </div>
    );
};

export default NavBar;
